import "./mine.css";
import Tips from "./components/tips/tip";

function mine(props){
    const tipItem= props.tipsData.map((item, index) => <Tips index={index} key={item.id} id={item.id} pic={item.pic} desc={item.desc}/>);
    return(
    <div className="mine-bg">
        <div id="self-info">
            <div id="avatar"></div>
            <div id="self-intro">张天弋<p id="stu-num">2022214959</p></div>
            <div id="more-info">详情</div>
            <div id="arrow"></div>
        </div>
        <div id="morefunc">
        {tipItem}
        </div>
        </div>
    )
}
export default mine;
